import React, { Component } from "react";
import { Card, Tooltip } from "@material-ui/core";
import ArchiveOutlinedIcon from "@material-ui/icons/ArchiveOutlined";
import { addInArchive } from "./Service";

export class UnArchive extends Component {

    handleUnarchiveChange=()=>{

        let token = localStorage.getItem("Token");
        let noteid = this.props.propsaUnrchivenote;
        console.log(token);
        console.log(noteid);
        addInArchive(noteid, token)
        .then(Response => {
          console.log("note is archive");
        })  .catch(err => {
            console.log("error");
          });

    }
   render() {
    return <div>

            <Tooltip title=" Unarchive">
              <ArchiveOutlinedIcon   onClick={this.handleUnarchiveChange}/>
            </Tooltip>

    </div>;
  }
}

export default  UnArchive;
